import React from "react";
import { AdvancedChart } from "react-tradingview-embed";

function Charts() {
    return (
        <div ClassName="Chart">
            <AdvancedChart
                widgetProps={{
                    autosize: true,
                    symbol: "NASDAQ:AAPL",
                    timezone: "Etc/UTC",
                    theme: "dark",
                    style: "1",
                    locale: "en",
                    toolbar_bg: "#f1f3f6",
                    enable_publishing: false,
                    withdateranges: true,
                    range: "1D",
                    hide_side_toolbar: false,
                    allow_symbol_change: true,
                    watchlist: ["NASDAQ:AAPL"],
                    details: true,
                    hotlist: true,
                    calendar: true,
                    show_popup_button: true,
                }}
            />
        </div>
    );
}

export default Charts;
